import React from "react";

import { app, appHeader } from "./App.module.css";

function App() {
  return (
    <div className={app}>
      <header className={appHeader}>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
